import React from 'react'

function GifCard(props) {
    const {post} = props

    return (
        <div id = "GifSearch">
            <div>
                {post.map(element => {
                    return(
                        <div id = "gif" key={element.id}>
                        <img src = {element.images.original.url} alt = "GIFs"/>
                        </div>

                )})}</div>
        </div>
    );
}

export default GifCard
